import Expenses from './components/Expenses';

function App() {

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses
        title={props.title}
        amount={props.amount}
        date={props.date}

      />

      <ExpenseItem
        title={expenses[1].title} 
        amount={expenses[1].amount} 
        date={expenses[1].date} 
      />

      <ExpenseItem
        title={expenses[2].title} 
